import "./style.css";

function App() {
  return (
    <header className="header">
      <div className="logo">
        <img src="./logo.png" alt="logo" />
        <h1>React Project </h1>
      </div>
      <button className="btn btn-large btn-open">Share A Fact</button>
    </header>
  );
}
export default App;
